import React from 'react';
import './card.css';
import ArrDataOfCards from '../generate-data';
//const nameOne = ...ArrDataOfCards;
/*
    ArrDataOfCards.forEach(function (item) {
        return (
            <article className="card-item">
                <div className="cards-image__container">
                    <img className="cards-image" src={require('./img/test.png')} alt="anapa"/>
                </div>
                <section className="card-item__description">
                    <h4 className="description-name">{item.name}</h4>
                    <p className="track-shedule"><b>Маршрут:</b>{}</p>
                    <p className="duration"><b>Продолжительность:</b>{}</p>
                    <p className="price">27 000 руб</p>
                </section>
            </article>
        )
    })
*/
export default class Card extends React.Component {
   /*
    render() {
        return (
            <article className="card-item">
                <div className="cards-image__container">
                    <img className="cards-image" src={require('./img/test.png')} alt="anapa"/>
                </div>
                <section className="card-item__description">
                    <h4 className="description-name">ppp</h4>
                    <p className="track-shedule"><b>Маршрут:</b>{}</p>
                    <p className="duration"><b>Продолжительность:</b>{}</p>
                    <p className="price">27 000 руб</p>
                </section>
            </article>
        )
    }
    */
   render() {
    return (ArrDataOfCards.forEach(function (item) {
        return `<article className="card-item">
                <div className="cards-image__container">
                    <img className="cards-image" src={require('./img/test.png')} alt="anapa"/>
                </div>
                <section className="card-item__description">
                    <h4 className="description-name">${item.name}</h4>
                    <p className="track-shedule"><b>Маршрут:</b>{}</p>
                    <p className="duration"><b>Продолжительность:</b>{}</p>
                    <p className="price">27 000 руб</p>
                </section>
            </article>`
        }))
    }
}
